import React from 'react';
import ReactDOM from 'react-dom'
import Card from "./Card";
import './index.css';
import data from "./netflixData";
import googleData from "./googleData";
import Counter from './hooks/counter';
import HandlingEvents from './hooks/handlingEvents';
import BasicForm from "./form/basicForm";


const App = () => {
    return (
        <div>

<div class="tab">
  <button class="tablinks" onclick="openCity(event, 'London')">London</button>
  <button class="tablinks" onclick="openCity(event, 'Paris')">Paris</button>
  <button class="tablinks" onclick="openCity(event, 'Tokyo')">Tokyo</button>
</div>

<div id="London" class="tabcontent">
  <h3>London</h3>
  <p>London is the capital city of England.</p>
</div>

<div id="Paris" class="tabcontent">
  <h3>Paris</h3>
  <p>Paris is the capital of France.</p> 
</div>

<div id="Tokyo" class="tabcontent">
  <h3>Tokyo</h3>
  <p>Tokyo is the capital of Japan.</p>
</div>


        <div style={{ display: 'block', clear: 'both' }}>
            <h1 className="heading_style">List of top nexflix series in 2021</h1>


            {data.map((val) => {
                console.log(val);
                return (
                    <Card
                        key={val.id}
                        imgsrc={val.imgsrc}
                        title={val.title}
                        sname={val.sname}
                        link={val.link} />

                );
            })}
        </div>
        <div style={{ display: 'block', clear: 'both' }}>
            <h1 className="heading_style">Get Time</h1>

            <Counter/>
           
        </div>
        <div style={{ display: 'block', clear: 'both' }}>

            <HandlingEvents/>
           
        </div>
        <div style={{ display: 'block', clear: 'both' }}>

            <BasicForm/>
           
        </div>

        
        </div>
    )
}


export default App;
